//   margin: auto;

// `

const StyledPageContent = styled.div`
  background-color: ${props => props.theme.white};
  padding: 6.4rem;
  width: 100%;
  height: 1000px;
  margin: 5.4rem 0;
`

const PageContent = props => (
  <StyledPageContent>
    {props.children}
  </StyledPageContent>
)

export default PageContent
